    # Find divisors of a
    divisors_a = []
    for i in range(1, a+1):
        if a % i == 0:
            divisors_a.append(i)

    # Find divisors of b
    divisors_b = []
    for i in range(1, b+1):
        if b % i == 0:
            divisors_b.append(i)

    # Find the common divisors
    common_divisors = []
    for divisor in divisors_a:
        if divisor in divisors_b:
            common_divisors.append(divisor)

