def powers_of_2(n):
    # Base case: if n is 1, it can be represented as 2^0
    if n == 1:
        return True

    # Try all powers of 2 less than n
    power = 0
    while True:
        # Calculate the current power of 2
        current = 2 ** power

        # If the current power is greater than n, n cannot be represented
        if current > n:
            return False

        # If the current power is equal to n, n can be represented
        if current == n:
            return True

        # Otherwise, recursively check if n can be represented using the remaining sum
        if powers_of_2(n - current):
            return True

        # Increment the power
        power += 1

