    lis = [1] * n
    for i in range(1, n):
        for j in range(i):
            if arr[i] > arr[j] and lis[i] < lis[j] + 1:
                lis[i] = lis[j] + 1

    # Calculate the longest decreasing subsequence (LDS) starting at each index
    lds = [1] * n
    for i in range(n-2, -1, -1):
