def longest_palindromic_subsequence(s):
    n = len(s)
    # Create a table to store the lengths of longest palindromic subsequences
    dp = [[0] * n for _ in range(n)]

    # All substrings of length 1 are palindromes of length 1
    for i in range(n):
        dp[i][i] = 1

    # Consider substrings of length 2 and more
    for length in range(2, n+1):
        for i in range(n-length+1):
            j = i + length - 1
            if s[i] == s[j] and length == 2:
                dp[i][j] = 2
            elif s[i] == s[j]:
                dp[i][j] = dp[i+1][j-1] + 2
            else:
                dp[i][j] = max(dp[i+1][j], dp[i][j-1])

    # The length of the longest palindromic subsequence is stored in dp[0][n-1]
    return dp[0][n-1]

