def max_sum_with_element(nums, k):
    n = len(nums)
    dp = [0] * n
    dp[0] = nums[0]

    for i in range(1, n):
        dp[i] = nums[i]
        for j in range(i):
            if nums[i] > nums[j]:
                dp[i] = max(dp[i], dp[j] + nums[i])

    max_sum = max(dp)
    if k > n:
        return max_sum

    max_sum_with_k = max_sum + nums[k]
    return max(max_sum, max_sum_with_k)

