def remove_lowercase_substrings(string):
    result = ""
    i = 0
    while i < len(string):
        if string[i].islower():
            # Find the end index of the lowercase substring
            end = i + 1
            while end < len(string) and string[end].islower():
                end += 1

            # Skip the lowercase substring
            i = end
        else:
            # Append the current character to the result
            result += string[i]
            i += 1

    return result

